import Chart from './Chart'




const Card = props=>
{
    return(
        <div className="card-container">
            <div className="image-container">
                <img src = {props.imageUrl} alt='Random Image'></img>
                {/* <Chart/> */}
            </div>
             <div className="card-contents">
               <div className="card-title">
                   <h3>{props.title}</h3>
                </div>
                <div className="card-body">
                   <p>{props.body}</p>
                </div>
            </div>

            <div className="btn">
                <button>
                    <a>
                        View More
                    </a>
                </button>
            </div>


        </div>

    );


}

export default Card;
